В нашем меню аппетитная пицца, роллы, вок, широкий выбор закусок и десертов, супы, свежие салаты, напитки на любой вкус. Не нашли то, что хотели? Соберите пиццу из двух половин или создайте свой уникальный рецепт в конструкторе. Не нравится лук или маслины? Меняйте рецепт и мы приготовим его!
Доступна оплата с помощью Apple Pay;
Можно посмотреть в онлайне, как готовится именно ваш заказ, и увидеть результат на фотографии в личном кабинете;
Отслеживание местоположения курьера на карте;
История заказов, с возможностью повтора в один клик;
Гибкая бонусная система;
Доставка по геопозиции.

